import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import '../styles/home.css';

function Dashboard() {
  const navigate = useNavigate();
  const [selectedDate, setSelectedDate] = useState(new Date());

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  // Función para formatear la fecha
  const formatDate = (date) => {
    const y = date.getFullYear();
    const m = String(date.getMonth() + 1).padStart(2, '0');
    const d = String(date.getDate()).padStart(2, '0');
    return `${y}-${m}-${d}`;
  };

  const selectedDateStr = formatDate(selectedDate);
  
  // Ejemplo de tareas para la fecha seleccionada (puedes adaptarlo)
  const tasksByDate = {
    '2025-03-13': ['Ir al médico', 'Enviar correo a Pedro'],
    '2025-03-15': ['Comprar regalo', 'Llamar a Juan']
  };
  const tasksForSelectedDate = tasksByDate[selectedDateStr] || [];

  return (
    <div className="home-container">
      <header className="top-bar">
        <div className="left-section">
          <i className="fa fa-user-circle user-icon" aria-hidden="true"></i>
        </div>
        <div className="center-section">
          <h1 className="title">JANUS</h1>
        </div>
        <div className="right-section">
          <i className="fa fa-bell bell-icon" aria-hidden="true"></i>
          <button className="logout-btn" onClick={() => navigate('/')}>
            <i className="fa fa-sign-out" aria-hidden="true"></i>
            <span>Cerrar Sesión</span>
          </button>
        </div>
      </header>

      <main className="main-content">
        <div className="calendar-and-buttons">
          <div className="buttons-block">
            <button className="option-btn btn-tareas" onClick={() => navigate('/planner')}>
              TAREAS PLANIFICADAS
            </button>
            <button className="option-btn btn-recordatorios" onClick={() => navigate('/recordatorios')}>
              RECORDATORIOS
            </button>
            <button className="option-btn btn-feedback" onClick={() => navigate('/messaging')}>
              FEEDBACK
            </button>
            {/* Botón desbloqueado para Mi diario de emociones */}
            <button className="option-btn" onClick={() => navigate('/diario-de-emociones')}>
              MI DIARIO DE EMOCIONES
            </button>
          </div>
          <div className="calendar-box">
            <Calendar onChange={handleDateChange} value={selectedDate} />
          </div>
        </div>
        <div className="tasks-list">
          <h3>Tareas para {selectedDateStr}</h3>
          {tasksForSelectedDate.length === 0 ? (
            <p>No hay tareas para este día</p>
          ) : (
            <ul>
              {tasksForSelectedDate.map((task, idx) => (
                <li key={idx}>{task}</li>
              ))}
            </ul>
          )}
        </div>
      </main>

      <section className="welcome-section">
        <h2>¡BIENVENIDO A JANUS!</h2>
        <p>
          Una aplicación destinada a ayudarte de la mejor manera posible con tus
          problemas de administración y balance de tareas.
        </p>
      </section>

      <footer className="footer-bar">
        <p>2025 © Iván Vela Campos</p>
      </footer>
    </div>
  );
}

export default Dashboard;
